// @updateURL https://update.greasyfork.org/scripts/531456/%E6%96%B9%E4%B8%88%E5%BD%B1%E8%A7%86-%E5%85%A8%E4%BC%9A%E5%91%98%E7%89%88-%E3%80%90%E8%85%BE%E8%AE%AF%E3%80%91%E3%80%90%E7%88%B1%E5%A5%87%E8%89%BA%E3%80%91%E3%80%90%E4%BC%98%E9%85%B7%E3%80%91%E3%80%90%E8%8A%92%E6%9E%9C%E3%80%91.meta.js
