// **********************************************************************************************
// 本脚本为方丈为了测试脚本开发实现的小玩意，感谢使用！
// 更多问题请在“火猿扩展”中反馈，全功能版本，请访问：https://docs.fireape.cn/
// **********************************************************************************************

// 默认选中的解析路线
  let index = 0;
  let timer = 0;
  let isVisibility = true;
  let logo = "data:image/jpeg;base64,"

  // 播放节点
  const playerNodes = [
    {
      name: "腾讯视频",
      node: "#player",
      box: ".playlist-vip-section__vip",
    },
    {
      name: "爱奇艺视频",
      node: ".Video_container__jfBSy",
      box: "#marketing_bk",
    },
    {
      name: "优酷视频",
      node: "#ykPlayer",
      box: ".cardContentVip",
    },
    {
      name: "芒果TV",
      node: ".mango-player",
      box: ".vip-button-box",
    }
  ]

  // 解析接口
  const jxLines = [
    {
      name: "2S0",
      url: "https://jx.2s0.cn/player/?url=",
    },
    {
      name: "盘古",
      url: "https://www.pangujiexi.com/jiexi/?url=",
    },
    {
      name: "虾米",
      url: "https://jx.xmflv.com/?url=",
    },
    {
      name: "夜幕",
      url: "https://www.yemu.xyz/?url=",
    },
    {
      name: "CK",
      url: "https://www.ckplayer.vip/jiexi/?url=",
    },
    {
      name: "U8",
      url: "https://jx.m3u8.tv/jiexi/?url=",
    },
    {
      name: "8090",
      url: "https://www.8090g.cn/?url=",
    },
    {
      name: "PM",
      url: "https://www.playm3u8.cn/jiexi.php?url=",
    },
    {
      name: "云溪",
      url: "https://jx.yparse.com/index.php?url=",
    },
    {
      name: "站外播放",
      url: "https://vip.fireape.cn?from=",
      offSite: true
    }
  ]

  // 创建播放器
  function createPlayer(node, url) {
    const player = document.createElement("iframe")
    node.innerHTML = ""
    node.style = "position: relative"
    player.id = "fz-player"
    player.style = "height:100%;width:100%;position:absolute;top:0;left:0;z-index: 999;"
    player.setAttribute("src", url)
    player.setAttribute("allow", "fullscreen; autoplay; picture-in-picture; encrypted-media");
    const parentNode = node.parentNode
    parentNode.appendChild(player)
  }

  function createOverLogo(node) {
    const l = document.createElement("img")
    l.setAttribute('src', logo)
    l.style = "height:100%;width:100%;position:absolute;top:0;left:0;z-index: 9999;"
    node.appendChild(l)
    return l
  }

  function run() {
    GM_setValue("url", location.href)
    index = GM_getValue("index") ?? 0
    playerNodes.forEach(p => {
      const node = document.querySelector(p.node)
      if(node) {
        const l = createOverLogo(node)
        l.addEventListener("click", async() => {
          const url = `${jxLines[index].url}${window.location.href}`
          createPlayer(node, url)
        })
      }
    })
  }

  function setTimer() {
    clearInterval(timer)
    timer = setInterval(async() => {
      // 暂停广告和原视频
      const vs = document.querySelectorAll("video")
      vs.forEach(v => {
        v.muted = true;
        v.pause();
      })

      // 修复集点击无效问题
      const url = GM_getValue("url")
      if(url !== location.href && isVisibility) {
        GM_setValue("url", location.href)
        location.href = location.href
      }

      // 创建换源控制盒子
      createBox()
    }, 200)
  }

  function createBox() {
    const f = document.querySelector("#fz-box")
    if(f) return

    const fzBox = document.createElement("div")
    fzBox.id = "fz-box"

    const fzMain = document.createElement("div")
    fzMain.id = "fz-main"
    fzBox.appendChild(fzMain)

    // 创建 style 元素并设置样式内容
    const styleElement = document.createElement('style');
    const styleContent = `
            #fz-box{
                padding: 10px;
            }
            #fz-box #fz-main {
                border: 1px solid #ccc;
                padding: 10px;
                width: auto;
                background-color: #333;
                border-radius: 5px;
                color: white;
            }
            #fz-box ul {
                list-style-type: none;
                padding: 0;
                display: flex;
                flex-wrap: wrap;
            }
            #fz-box ul li {
                padding: 2px 5px;
                cursor: pointer;
                margin: 5px;
                font-size: 12px;
                border: 1px solid #333;
            }
            #fz-box ul li.selected {
                color: #fff;
                border: 1px solid #fff;
                border-radius: 5px;
            }
            .preview-mini-player,.panel-tip-pay-video {
                display: none!important;
            }
            .topheader_top_header_box,#m-topheader {
                z-index: 999999;
            }
        `;
    styleElement.textContent = styleContent;
    document.head.appendChild(styleElement);
    const tagList = document.createElement('ul');
    jxLines.forEach((item, i) => {
      const listItem = document.createElement('li');
      listItem.textContent = item.name;
      listItem.setAttribute("index", i);
      if (i == index) listItem.classList.add('selected');
      listItem.addEventListener('click', function () {
        index = this.getAttribute("index") ?? 0;
        const url = `${jxLines[index].url}${window.location.href}`;
        if(item.offSite) {
          window.open(url, '_blank')
          return
        }
        const allItems = tagList.querySelectorAll('li');
        allItems.forEach(li => li.classList.remove('selected'));
        this.classList.add('selected');
        GM_setValue("index", index)
        const player = document.querySelector("#fz-player")
        if(player) player.setAttribute("src", url);
      });
      tagList.appendChild(listItem);
    });
    fzMain.appendChild(tagList)

    playerNodes.forEach(p => {
      const box = document.querySelector(p.box)
      if(box) {
        box.innerHTML = ""
        box.appendChild(fzBox)
      }
    })
  }

  document.addEventListener('visibilitychange', function () {
    if (document.hidden) {
      isVisibility = false
    } else {
      isVisibility = true
    }
  });

  setTimer()
  run()